import Button from "@mui/material/Button";
import ButtonGroup from "@mui/material/ButtonGroup";
import Box from "@mui/material/Box";
import React from "react";

class StartButton extends React.Button {
  render() {
    return (
      <>
        <Box
          sx={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            "& > *": {
              m: 2,
            },
          }}
        >
          <ButtonGroup
            size="large"
            variant="text"
            aria-label="text button group"
            color="inherit"
          >
            <Button onClick={activateSearchTab}>검색</Button>
            <Button onClick={activateMap}>지도</Button>
          </ButtonGroup>
        </Box>
      </>
    );
  }
}

export default StartButton;
